import Logo from "../../assets/images/logo.png"

function Header(){
    return(
        <Container>
            <Link href="/">
                <Image src={Logo}/>
            </Link>
            <ContainerLinks>
                <LinkMenu href="/course">Novo Curso</LinkMenu>
            </ContainerLinks>
        </Container>
    )
};

export default Header;
